// import { Component } from 'react'
import './component/Nav/Nav';
import NavRender from '../src/component/Nav/Nav'
import { Component } from 'react';
import VideoRender from './component/Video/Video';
import videoData from '../src/assets/Data/video-details.json';
// import randomName from '../src/assets/Data/videos.json';


class App extends Component {
  state = {
    renderedVideo: videoData[0]
  }

  render() {
    return (
      <div>
      <NavRender></NavRender>
      <VideoRender renderedVideo={this.state.renderedVideo}/>
      </div>
    );
  }
};

export default App;
